const MainStack = createBottomTabNavigator(
  {
    Feed : {screen : feed },
    Upload: {screen : upload },
    Profile: {screen : profile }
  }
)

export default class App extends React.Component{
  login = async() => {
    //Force user to login
    try {
        let user = await auth.signInWithEmailAndPassword('shashawatanand501@gmail.com','123456789');
    }catch(error){
      console.log(error);
    }
  }
  constructor(props){
    super(props);
    this.login();
  }
  render(){
    return (
       <MainStack/>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
